import './App.css';
const numbers = Array.from(Array(20).keys());
const output = [];

function fizzBang(n) {
	for(var i=1; i<=n; i++){
		console.log(i);
		output.push(i);
	}
};
function Output() {
	fizzBang(numbers);
	return (
	<li></li>
	)
};

function App() {
 return (
    <div className="App">
<ul>
<Output />;
</ul>
    </div>
  );
}

export default App;
